import React from 'react';
import cover1 from './../img/cover1.jpg';
import './../stylesheets/css/style.css';

function Main() {
  return (
    <main>
      {/* <img src={logo} className="App-logo" alt="logo" /> */}
      <h2>Releases</h2>
      <div>
        <img src={cover1}></img>
        <h3>BoSsOb</h3>
        <h4>Tracklist</h4>
        <ul>
          <li>01. BoS</li>
          <li>02. sOb</li>
          <li>01. BoS (Corvum Hypnotic Version)</li>
          <li>02. sOb (A Thousand Details Remix)</li>
        </ul>
      </div>
    </main>
  );
}

export default Main;
